async function generateRandomNumbers({ utils }) {
  const generateRandomNumber = () => Math.floor(Math.random() * 100);

  const randomNumbers = Array.from({ length: 5 }, () => [
    generateRandomNumber(),
    generateRandomNumber(),
  ]);

  return randomNumbers;
}

async function fnName({ input, utils }) {
  // Sum all the numbers in the input array
  const sum = input.reduce((acc, num) => acc + num, 0);

  // Return the sum
  return sum;
}

async function concatenateStrings({ input, utils }) {
  // Concatenate the strings with a slash between them
  const concatenatedString = input.join('/');

  // Return the concatenated string
  return concatenatedString;
}

async function multiplyNumbers({ input, utils }) {
  const { a, b } = input;
  return a * b;
}

async function reverseString({ input, utils }) {
  // Reverse the input string
  const reversedString = input.split('').reverse().join('');
  return reversedString;
}
